script: |
  super -f text -I q1065.spq | sort > q1065.out

inputs:
  - name: q1065.spq
    data: |
      SELECT ALL + ( + ( - - col0 ) ) + - col2 + 71, - col1 / col0 * - 65 * + + 81 AS col0 FROM tab0 (FORMAT parquet) AS cor0;
  - name: tab0

outputs:
  - name: q1065.out
    data: |
      148	0
      39	26325
      69	0
